.com\"\n  echo \"‚ùå [GoogleSignIn] Got: $IOS_CLIENT_ID\"\n  if echo \"${CONFIGURATION:-}\" | grep -qi \"Debug\"; then\n    exit 0\n  fi\n  exit 1\nfi\nSCHEME=\"com.googleusercontent.apps.${PREFIX}\"\n\necho \"‚úÖ [GoogleSignIn] iOS client id present (len=${#IOS_CLIENT_ID}) => scheme: $SCHEME\"\n\n# Inject keys into built plist (create if missing)\n/usr/libexec/PlistBuddy -c \"Set :GIDClientID $IOS_CLIENT_ID\" \"$PLIST\" 2>/dev/null || \\\n/usr/libexec/PlistBuddy -c \"Add :GIDClientID string $IOS_CLIENT_ID\" \"$PLIST\"\n\nWEB_CLIENT_ID=\"${EXPO_PUBLIC_GOOGLE_WEB_CLIENT_ID:-}\"\nif [ -z \"$WEB_CLIENT_ID\" ]; then\n  WEB_CLIENT_ID=\"$(read_env_file \"$ENV_FILE_LOCAL\" \"EXPO_PUBLIC_GOOGLE_WEB_CLIENT_ID\")\"\nfi\nif [ -z \"$WEB_CLIENT_ID\" ]; then\n  WEB_CLIENT_ID=\"$(read_env_file \"$ENV_FILE_DOTENV\" \"EXPO_PUBLIC_GOOGLE_WEB_CLIENT_ID\")\"\nfi\n# Fallback: read from source Info.plist\nif [ -z \"$WEB_CLIENT_ID\" ]; then\n  SOURCE_PLIST=\"${SRCROOT}/DondeBailarMX/Info.plist\"\n  if [ -f \"$SOURCE_PLIST\" ]; then\n    WEB_CLIENT_ID=\"$(/usr/libexec/PlistBuddy -c \"Print :GIDServerClientID\" \"$SOURCE_PLIST\" 2>/dev/null || true)\"\n  fi\nfi\n\nif [ -n \"$WEB_CLIENT_ID\" ]; then\n  /usr/libexec/PlistBuddy -c \"Set :GIDServerClientID $WEB_CLIENT_ID\" \"$PLIST\" 2>/dev/null || \\\n  /usr/libexec/PlistBuddy -c \"Add :GIDServerClientID string $WEB_CLIENT_ID\" \"$PLIST\"\nfi\n\n# Optional: enable release logging via env var\nDEBUG_FLAG=\"${EXPO_PUBLIC_GOOGLE_SIGNIN_DEBUG:-}\"\nif [ \"$DEBUG_FLAG\" = \"1\" ] || [ \"$(printf \\\"%s\\\" \\\"$DEBUG_FLAG\\\" | tr '[:upper:]' '[:lower:]')\" = \"true\" ]; then\n  /usr/libexec/PlistBuddy -c \"Print :BAILEAPP_GOOGLE_SIGNIN_DEBUG\" \"$PLIST\" >/dev/null 2>&1 && \\\n    /usr/libexec/PlistBuddy -c \"Set :BAILEAPP_GOOGLE_SIGNIN_DEBUG true\" \"$PLIST\" || \\\n    /usr/libexec/PlistBuddy -c \"Add :BAILEAPP_GOOGLE_SIGNIN_DEBUG bool true\" \"$PLIST\"\nfi\n\n# Ensure CFBundleURLTypes[0].CFBundleURLSchemes contains the reversed scheme\n/usr/libexec/PlistBuddy -c \"Print :CFBundleURLTypes\" \"$PLIST\" >/dev/null 2>&1 || \\\n  /usr/libexec/PlistBuddy -c \"Add :CFBundleURLTypes array\" \"$PLIST\"\n/usr/libexec/PlistBuddy -c \"Print :CFBundleURLTypes:0\" \"$PLIST\" >/dev/null 2>&1 || \\\n  /usr/libexec/PlistBuddy -c \"Add :CFBundleURLTypes:0 dict\" \"$PLIST\"\n/usr/libexec/PlistBuddy -c \"Print :CFBundleURLTypes:0:CFBundleURLSchemes\" \"$PLIST\" >/dev/null 2>&1 || \\\n  /usr/libexec/PlistBuddy -c \"Add :CFBundleURLTypes:0:CFBundleURLSchemes array\" \"$PLIST\"\n\nif ! /usr/libexec/PlistBuddy -c \"Print :CFBundleURLTypes:0:CFBundleURLSchemes\" \"$PLIST\" | grep -Fq \"$SCHEME\"; then\n  /usr/libexec/PlistBuddy -c \"Add :CFBundleURLTypes:0:CFBundleURLSchemes: string $SCHEME\" \"$PLIST\" || true\nfi\n\necho \"üìå [GoogleSignIn] Done.\"\n";
